import Home from '../pages/Home';
import Login from '../pages/Login';

export const BASIC_ROUTER_CONFIG = [
    {
        path: '/',
        exact: true,
        component: Home,
        auth: []
    },
    {
        path: '/login',
        exact: false,
        component: Login,
        auth: []
    }
    ];
